import React, { useState } from 'react'
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import GraduateAcc from './accounts/GraduateAcc'
import SavingAcc from './accounts/SavingsAcc'
import Home from './Home'
import './App.css'

function App () {
  const [transactions, setTransactions] = useState([])

  const fetchTransactions = (accountType) => {
    fetch(`http://localhost:8080/api/transactions?accountType=${accountType}`)
      .then(response => response.json())
      .then(data => setTransactions(data))
      .catch(error => console.error('Error fetching transactions:', error))
  }

  return (
    <BrowserRouter>
      <div className='App'>
        <h1>Banking App</h1>
        <div className='page-body'>
          <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/graduate' element={<GraduateAcc />} />
            <Route path='/savings' element={<SavingAcc />} />
          </Routes>
          <div>
            <button onClick={() => fetchTransactions('savings')}>Savings Account</button>
            <button onClick={() => fetchTransactions('checking')}>Checking Account</button>
            <button onClick={() => fetchTransactions('business')}>Business Account</button>          </div>
          <TransactionTable transactions={transactions} />
        </div>
      </div>
    </BrowserRouter>
  )
}

function TransactionTable({ transactions }) {
  return (
    <div>
      <h2>Transactions</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>User ID</th>
            <th>Account From</th>
            <th>Account To</th>
            <th>Amount</th>
          </tr>
        </thead>
        <tbody>
          {transactions}
        </tbody>
      </table>
    </div>
  )
}

export default App

